-- SQLINES FOR EVALUATION USE ONLY (14 DAYS)
CREATE TABLE bon_pds (
  id varchar(255) NOT NULL,
  part varchar(255) NOT NULL,
  deskripsi text NOT NULL,
  qty_bonpds int NOT NULL DEFAULT 0,
  status_bonpds varchar(30) check (status_bonpds in ('BON','RECEIVED','CANCELED')) NOT NULL DEFAULT 'BON',
  site_bonpds varchar(255) NOT NULL,
  tanggal_bonpds date NOT NULL,
  no_transaksi varchar(100) NOT NULL,
  keterangan text DEFAULT NULL,
  stock_updated smallint DEFAULT 0,
  created_at timestamp(0) NOT NULL DEFAULT current_timestamp(),
  updated_at timestamp(0) NOT NULL DEFAULT current_timestamp() /* ON UPDATE current_timestamp() */
) ;

-- SQLINES DEMO *** ---------------------------------------

--
-- SQLINES DEMO *** or table `daily_bon`
--

CREATE TABLE daily_bon (
  id varchar(255) NOT NULL,
  part varchar(255) NOT NULL,
  deskripsi text NOT NULL,
  qty_dailybon int NOT NULL DEFAULT 0,
  harga decimal(15,2) NOT NULL DEFAULT 0.00,
  status_bon varchar(30) check (status_bon in ('BON','RECEIVED','KMP','CANCELED')) NOT NULL DEFAULT 'BON',
  teknisi varchar(255) NOT NULL,
  tanggal_dailybon date NOT NULL,
  no_tkl varchar(100) NOT NULL,
  keterangan text DEFAULT NULL,
  stock_updated smallint DEFAULT 0,
  created_at timestamp(0) NOT NULL DEFAULT current_timestamp(),
  updated_at timestamp(0) NOT NULL DEFAULT current_timestamp() /* ON UPDATE current_timestamp() */
) ;

